                    <input type="submit" 
                        id="login-btn" 
                        value="Sign In" />
                </div>
                <div className="loginForm2">
                    Don't have an account ?
                    <Link to="/signup">
                        <span style={{ color: "blue", cursor: "pointer" }}>Sign Up</span>
                    </Link>
                </div>
            </div>
        </div>
    );
}
